import Linegraph from '../Widgets/Linegraph'; 
import '../CSS/Start.css'

function Game() {


    return (
        <div>
            <Navigation tab='3' />
            <div className="contanier">
                <Container maxWith='m' style={{ top: '30%', left: '30%', display: 'block', position: 'absolute' }} >
                    <Row>
                        <CardItem CardContent= {<Linegraph/>}  />
                        <CardItem />

                    </Row>
                    <Row>
                    </Row>
                    {/* <div> <Tasks /> </div> */}
                </Container>
            </div>
        </div>
    );
}
export default Game;
